const DUMMY_EVENTS = [
    {
        id: 'e1',
        titl: 'Some event',
    },
    {
        id: 'e2',
        title: 'Some event2'
    }
]

function EventsPage() {
    return (
        <>
            <h1>Events Page</h1>
            {DUMMY_EVENTS.map(events => {
                <li key={events.id}>{events.title}</li>
            })}
        </>
    )
}

export default EventsPage;
